import React, {Component} from "react";
import Axios from 'axios';

class LogIn extends Component{
    constructor(){
        super();
        this.state = {
            email: '',
            password: ''
        };
        this.handleChange = this.handleChange.bind(this);
        
    }

    handleChange(event){
        const {name, value} = event.target;
        this.setState({
            [name]: value
        });
    }

    onSubmit = () => {
        Axios.post('http://localhost:8000/api/insert', {email: this.state.email, password: this.state.password})
        .then(() => {
            alert('Success!');
        });
    }

    render(){
        return (
            <div>
                <h1>Log in</h1>
                <div>
                    <input type="text" name="email" placeholder="Email" onChange={this.handleChange} value={this.state.email}/><br/>
                    <input type="text" name="password" placeholder="Password" onChange={this.handleChange} value={this.state.password}/><br/>
                    <button onClick={this.onSubmit}>Submit</button>
                </div>
                <a href="/">Home</a><br />
                <a href="/signup">Sign up</a>
            </div>
        );
    }
}

export default LogIn;
